INSERT INTO `features` (`id`, `icon`, `title`, `description`, `image`, `order`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'Bot', 'Balas Chat Otomatis 24/7', 'Chatbot AI Cerdas dan Humanis otomatis menjawab pelanggan kapan saja, bahkan saat CS offline atau sedang membalas pesan lain', NULL, 1, 1, '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(2, 'Bell', 'Follow Up Otomatis', 'Terkadang, pelanggan tidak langsung membeli setelah chat pertama. Dengan ChatCepat kamu bisa mengatur pesan follow-up otomatis', NULL, 2, 1, '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(3, 'Megaphone', 'Broadcast Terjadwal', 'Kirim promosi ke pelanggan secara aman melalui broadcast WhatsApp dan Email, bertahap, dan manusiawi sehingga risiko banned menjadi minim', NULL, 3, 1, '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(4, 'Users', 'Human Agent', 'Ada pertanyaan pelanggan yang terlalu kompleks untuk dijawab oleh chatbot AI? ChatCepat memungkinkan chatbot untuk dialihkan ke CS manusia.', NULL, 4, 1, '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(5, 'Grid', 'Open API - Integrasi Mudah', 'Setting dan Integrasi sangat mudah. Tinggal scan barcode seperti memakai WhatsApp versi web.', NULL, 5, 1, '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(6, 'Calculator', 'Hitung Ongkos Kirim Otomatis', 'Chatbot AI Cerdas bisa melakukan perhitungan ongkos kirim dengan pilihan kurir yang sudah di tentukan oleh pengguna.', NULL, 6, 1, '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(7, 'MessageSquare', 'Message Templating', 'Jika Anda ingin membalas chat dengan template, ChatCepat menyiapkan fitur yang memudahkan Anda membuat banyak template pesan, baik WhatsApp maupun Email.', NULL, 7, 1, '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(8, 'Languages', 'Multi-Language', 'AI Agent bisa merespons dalam berbagai bahasa. Anda tinggal menentukan AI Behavior dan memberikan AI Training dengan bahasa yang Anda inginkan.', NULL, 8, 1, '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(9, 'MonitorPlay', 'Plugin Live Chat', 'Tambahkan fitur chat ke website tanpa coding agar pelanggan lebih mudah terhubung tanpa berpindah ke WhatsApp / Aplikasi Lain.', NULL, 9, 1, '2026-01-08 03:10:56', '2026-01-08 03:10:56');

