INSERT INTO `fitur_unggulans` (`id`, `icon`, `title`, `description`, `image`, `order`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'MessageSquare', 'Balas Chat Otomatis', 'Membantu kamu melakukan automasi chat Non-Stop 24/7. Kamu bisa memilih automasi chat dengan template atau dengan bantuan AI Cerdas dan Humanis yang bisa kamu latih sesuai dengan bidang bisnis yang kamu jalankan.', NULL, 1, 1, '2026-01-08 08:01:01', '2026-01-08 08:01:01'),
(2, 'Bell', 'Followup Otomatis', 'Fitur Follow Up akan mengirimkan chat otomatis kepada konsumen setelah jeda tertentu dari chat terakhir. Misalnya, jika chat terakhir terjadi pukul 15.00 dan jeda follow up diatur 60 menit, maka pesan follow up akan terkirim pada pukul 16.00.', NULL, 2, 1, '2026-01-08 08:01:01', '2026-01-08 08:01:01'),
(3, 'MessageCircle', 'WhatsApp Templating', 'Mau balas chat atau broadcast WhatsApp dengan template pesan yang sudah siapkan? Dengan ChatCepat kamu bisa membuat template pesan dalam bentuk teks, teks + image, teks + video, dokumen, audio, list, button, location, dan polling.', NULL, 3, 1, '2026-01-08 08:01:01', '2026-01-08 08:01:01'),
(4, 'Users', 'Scraping Contacts', 'Membantu kamu mengambil kontak dari Google Maps. Sekali klik, boom! semua kontak langsung masuk ke dashboard ChatCepat kamu.', NULL, 4, 1, '2026-01-08 08:01:01', '2026-01-08 08:01:01'),
(5, 'Zap', 'Integrasi Ongkos Kirim', 'Pilih ekspedisi yang kamu inginkan untuk memudahkan Chatbot AI mengirimkan estimasi ongkos kirim ketika ada customer yang menanyakan.', NULL, 5, 1, '2026-01-08 08:01:01', '2026-01-08 08:01:01');

