INSERT INTO `posts` (`id`, `blog_category_id`, `user_id`, `title`, `slug`, `excerpt`, `content`, `featured_image`, `meta_title`, `meta_description`, `meta_keywords`, `views`, `status`, `published_at`, `created_at`, `updated_at`) VALUES
(1, 1, 1, 'Cara Memulai dengan ChatCepat', 'cara-memulai-dengan-chatcepat', 'Panduan lengkap untuk memulai perjalanan Anda dengan ChatCepat', 'ChatCepat adalah platform komunikasi modern yang memudahkan Anda untuk terhubung dengan tim. Dalam panduan ini, kami akan membahas langkah-langkah dasar untuk memulai menggunakan ChatCepat. Pertama, Anda perlu membuat akun dengan mendaftar menggunakan email. Setelah verifikasi email, Anda dapat langsung mulai menggunakan ChatCepat untuk berkomunikasi dengan tim Anda.', NULL, NULL, NULL, NULL, 0, 'published', '2026-01-08 03:10:56', '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(2, 2, 1, '10 Fitur ChatCepat yang Harus Anda Ketahui', '10-fitur-chatcepat-yang-harus-anda-ketahui', 'Temukan fitur-fitur powerful yang akan meningkatkan produktivitas tim Anda', 'ChatCepat hadir dengan berbagai fitur yang dirancang untuk meningkatkan produktivitas. Berikut adalah 10 fitur utama: 1) Pesan real-time 2) Grup chat 3) Pengiriman file 4) Voice & Video call 5) Screen sharing 6) Integrasi dengan tools lain 7) Bot automation 8) Search yang powerful 9) Notifikasi yang dapat dikustomisasi 10) End-to-end encryption.', NULL, NULL, NULL, NULL, 0, 'published', '2026-01-08 03:10:56', '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(3, 3, 1, 'Update ChatCepat v2.0: Fitur Baru yang Amazing', 'update-chatcepat-v20-fitur-baru-yang-amazing', 'ChatCepat v2.0 hadir dengan berbagai fitur baru yang menakjubkan', 'Kami dengan senang hati mengumumkan peluncuran ChatCepat v2.0! Update ini membawa banyak fitur baru termasuk dark mode, reactions pada pesan, thread untuk diskusi yang lebih terorganisir, dan peningkatan performa yang signifikan. Kami juga telah memperbaiki berbagai bug dan meningkatkan keamanan platform.', NULL, NULL, NULL, NULL, 0, 'published', '2026-01-08 03:10:56', '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(4, 4, 1, 'Cara Membuat Bot ChatCepat untuk Otomasi', 'cara-membuat-bot-chatcepat-untuk-otomasi', 'Tutorial lengkap membuat bot untuk mengotomasi tugas-tugas rutin', 'Bot di ChatCepat dapat membantu Anda mengotomasi berbagai tugas. Dalam tutorial ini, kami akan memandu Anda membuat bot sederhana yang dapat menjawab pertanyaan umum. Anda akan belajar cara mengatur webhook, membuat command, dan mengintegrasikan bot dengan API ChatCepat. Ikuti langkah-langkah berikut untuk membuat bot pertama Anda.', NULL, NULL, NULL, NULL, 0, 'published', '2026-01-08 03:10:56', '2026-01-08 03:10:56', '2026-01-08 03:10:56'),
(5, 1, 1, 'Tingkatkan Keamanan Akun ChatCepat Anda', 'tingkatkan-keamanan-akun-chatcepat-anda', 'Tips penting untuk menjaga keamanan akun ChatCepat', 'Keamanan akun adalah prioritas utama kami. Berikut adalah beberapa tips untuk meningkatkan keamanan akun ChatCepat Anda: 1) Aktifkan two-factor authentication 2) Gunakan password yang kuat dan unik 3) Jangan bagikan kredensial Anda 4) Review devices yang terhubung secara berkala 5) Logout dari session yang tidak digunakan. Dengan mengikuti tips ini, akun Anda akan lebih aman.', NULL, NULL, NULL, NULL, 0, 'published', '2026-01-08 03:10:56', '2026-01-08 03:10:56', '2026-01-08 03:10:56');

